import React from "react";
import HomeScreenIll from "../images/UrgentCareIllustration.png"

function Home() {
  return (
    <div className="home-screen">
      <div>
        <div className="home-screen-container">
          <div className="home-screen-text">
            <h1>Reimagining Urgent Care</h1>
            <h3>Deliver effortless care, analyze business trends, and grow your practice with our cohesive electronic ecosystem.</h3>
            <div className="home-screen-text__" >

            </div>
          </div>
          <img className="home-screen-container__ill" src={HomeScreenIll} alt="urgent care illustration"></img>
        </div>
      </div>
    </div>
  );
}

export default Home;
